import '../css/Card.css';
import React, { useState } from "react";
import { NavLink } from 'react-router-dom';


function Card() {
  return (   
        <div class="container">
             <NavLink to="/details"> 
                <img src="../assets/us.jpg" alt="Mandolin" />
                <h1>Mandolin</h1>
                <p>Mandolin that is lightly used, solid construction.</p>
                <span>Price: $40</span>
            </NavLink>
        </div>
  );
}

export default Card;
